import ImgLoading from "../../assets/loading.gif";
export default class Footer extends React.PureComponent {
    static propTypes = {};

    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div className={css.loading}>
                <img src={ImgLoading} />
                <div>Loading...</div>
            </div>
        );
    }
}
